import h1 from "../../assets/h1.png"
import h2 from "../../assets/h2.png"
import h3 from "../../assets/h3.png"

export class SectionThree extends Component {
    render() {
        return (
            <div className='px-5 lg:px-10 xl:px-36 2xl:px-52 flex flex-col mt-[6vw] h-screen'>

                <div className='w-full flex flex-col items-center gap-2'>
                    <span className='font-bold text-4xl'>How it work</span>
                    <span className='text-2xl opacity-55'>Keep calm & travel on</span>
                </div>

                <div className='flex flex-row'>

                    <div className='flex flex-col gap-3'>
                        <img className='w-36 h-36' src={h1}/>
                        <span>Book & relax</span>
                        <p className='text-center'>Let each trip be an inspirational journey, each room a peaceful space</p>
                    </div>

                </div>

            </div>
        );
    }
}
